// RPT 20200311 - Se agregan funciones para obtener el LANG, así como el servicio activo.
function InitializeMultilenguaje(apiKey) {
    Weglot.initialize({
        api_key: apiKey
    });
}

function booMultiLenguajeActivo() {
    return (Weglot == null || Weglot == undefined || Weglot.getCurrentLang() == undefined) ? false : true;
}

function GetMultiLenguajeLang() {
    return booMultiLenguajeActivo() ? Weglot.getCurrentLang() : 'es';
}

function GetTipMiltiLenguaje(strEspaniol, strIngles) {
    return "if (GetMultiLenguajeLang() == 'es'){Tip('" + strEspaniol + "', " + paramsToolsTip + ");}else{Tip('" + strIngles + "', " + paramsToolsTip + ");}";
}